import React, { useEffect } from "react";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import "./styles/style.css";

const Journal = () => {
  let journal = useSelector((state) => state.fetchJournal.journal);

  // const test = [
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
