  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  // ];

  useEffect(() => {
    fetch(
      `https://www.googleapis.com/blogger/v3/blogs/9085604028025620950/posts/fetchImages=true?key=AIzaSyChWrKyLjsVyYj42CKBstkjrOnKWwPLqDs`
    )
      .then((resp) => resp.json())
      .then((data) => console.log(data));
  });

  return (
    <div className="journal">
      {journal.map((entry, i) => (
        <Link
          style={{ textDecoration: "none", color: "black" }}
          key={i}
          to={`/Journal/${i}`}
        >
          <div className="entryContainer">
            <div>{`Title: ${entry.title}`}</div>
            <div className="info">
              <div>{`Entry: 000${i + 1}`}</div>
              <div>{`Posted: ${entry.published.slice(0, 10)}`}</div>
            </div>
          </div>
        </Link>
      ))}
      {/* {test.map((entry, i) => (
        <div key={i}>{entry.title}</div>
      ))} */}
    </div>
  );
};

export default Journal;
